prompt_example:
Δεδομένου ότι Αυτή η εικασία βασίζεται, τουλάχιστον εν μέρει, στην ηγεσία του Thumairy για μια εξτρεμιστική παράταξη στο τζαμί. Επομένως, πρέπει να ισχύει ότι "Αυτές οι ομάδες αποτελούσαν περισσότερο από το ήμισυ των μελών του τζαμιού."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Δεν έλεγε ξανά , γι 'αυτό με πήγε εκεί πέρα κι αγχωνόμουνα, και πραγματικά δεν ξέρω καν πότε χρειάζεται Επομένως, πρέπει να ισχύει ότι "Ανησύχησα πως θα έχανα την παράσταση, γιατί δεν ήξερα τι ώρα ήταν."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Ελπίζω ότι η κυριαρχία σου θα ξεκινήσει επιτέλους να αντιλαμβάνεται την παράνοια της χορήγησης της εντολής του βασιλιά σε έναν άνθρωπο όπως αυτόν, εναντίον όλων των συμβουλών μου. Επομένως, πρέπει να ισχύει ότι "Ενώ ο Εξοχότατος ήταν πολύ έξυπνος, το μέγα σφάλμα του να μην ακούσει τη συμβουλή μου θα σημάνει το τέλος του βασιλείου."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
